import React, { useState } from "react";
import "./Dashboard.css";
import Main from "../Main/Main";
import CreateProposal from "./CreateProposal/CreateProposal";
import ExecuteProposal from "./ExecuteProposal/ExecuteProposal";
import TransferShares from "./TransferShares/TransferShares";
import RedeemShares from "./RedeemShares/RedeemShares";
const Dashboard = () => {
  const [activeComponent, setActiveComponent] = useState(null);

  if (button.innerHTML == "Create Proposal") {
    <CreateProposal />;
    console.log("Create Proposal");
  } else if (button.text === "Execute Proposal") {
    <ExecuteProposal />;
    console.log("Execute Proposal");
  } else if (button.text === "Transfer Shares") {
    <TransferShares />;
    console.log("Transfer Shares");
  } else if (button.text === "Redeem Shares") {
    <RedeemShares />;
    console.log("Redeem Shares");
  }
  return (
    <aside>
      <div>
        <p>Create Proposal</p>
      </div>

      <div>
        <p>Execute Proposal</p>
      </div>
      <div>
        <p>Transfer Shares</p>
      </div>
      <div>
        <p>Redeem Shares</p>
      </div>
    </aside>
  );
};
export default Dashboard;
